import React, { Component } from 'react'

export default class ListMembers extends Component {
    constructor(props) {
        super(props)
    
        this.state = {
             members :[]
        }
    }
    
    
    render() {
        return (
            <div>
                <h2>List of Members</h2>
            </div>
        )
    }
}
